import React from 'react';
import classes from './ListTab.module.css';

const ListTab = (props) => {

	let isListTabClicked;
	console.log(props.isShown)
	if(props.isShown){
		isListTabClicked = 'classes.tabClicked';
	}
	else{
		isListTabClicked = 'classes.tabIsNotClicked';
	}

  return (
	  	<li className={isListTabClicked} onClick={props.showToDoList}>{props.title}</li>
  );
}

export default ListTab;
